INSERT INTO `projects` (`id`, `client`, `description`, `image_url`, `project_url`, `role`, `title`) VALUES
	(2, 'Học sinh, sinh viên, người đi làm', 'Giúp người dùng quản lý và tổ chức công việc thông qua việc tạo danh sách việc cần làm, lập lịch, đặt nhắc nhở và cộng tác với người khác. Ứng dụng giúp tăng năng suất cá nhân và nhóm bằng cách phân chia công việc, theo dõi tiến độ và đảm bảo không bỏ sót nhiệm vụ nhờ các tính năng như phân loại theo mức độ ưu tiên, tích hợp với các ứng dụng khác và khả năng truy cập đa nền tảng. ', '/uploads/1763631937433_1763552679881_1600w-cWqnlvI8ly4 (1).webp', 'https://github.com/VanMinh1802/learning/tree/main/mini-todo-backend-v2', 'Quản lý công việc cá nhân', 'Todo List');
